import React from 'react'

function ProductBox( { data } ) {
  return (
    <div className="product-wrapper">
        <input type="checkbox"/>
        <p>TR120555</p>
        <p>Chair</p>
        <p>40 000$</p>
        <p>Dimension: 24*45*15</p>
    </div>
  )
}

export default ProductBox
